import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../Styles/Data.css';

function DisplayData() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("/api/emp/get")
    .then((res) => {
      console.log(res);
      setData(res.data);
    })
    .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <h1>Employee Data</h1>
      <table>
        <thead>
          <tr>
            <th>EID</th>
            <th>Name</th>
            <th>NIC</th>
            <th>Salary</th>
            <th>Position</th>
            <th>Address</th>
            <th>Contact</th>
            <th>Update</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          <tr>

          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default DisplayData
